import React, { useState } from "react";
import { Calendar, User, ArrowRight, Search, Tag } from "lucide-react";

const Blog = () => {
  const [selectedCategory, setSelectedCategory] = useState("all");
  const [searchTerm, setSearchTerm] = useState("");
  const [selectedPost, setSelectedPost] = useState(null);

  const blogPosts = [
    {
      id: 1,
      title: "Life Path Number Basics",
      excerpt: "Learn how your Life Path Number reveals your life's purpose.",
      content: "Full content about Life Path Number...",
      author: "Sarah Mitchell",
      date: "2025-08-05",
      readTime: "8 min read",
      category: "Life Path",
      image: "https://via.placeholder.com/400x250",
      tags: ["Life Path", "Numerology"],
    },
    {
      id: 2,
      title: "Master Numbers 11, 22, 33",
      excerpt: "Explore the power of Master Numbers in numerology.",
      content: "Full content about Master Numbers...",
      author: "David Chen",
      date: "2025-08-03",
      readTime: "10 min read",
      category: "Master Numbers",
      image: "https://via.placeholder.com/400x250",
      tags: ["Master Numbers", "Spiritual Growth"],
    },
  ];

  const categories = ["all", "Life Path", "Master Numbers"];

  const filteredPosts = blogPosts.filter((post) => {
    const matchCat = selectedCategory === "all" || post.category === selectedCategory;
    const matchSearch =
      post.title.toLowerCase().includes(searchTerm.toLowerCase()) ||
      post.excerpt.toLowerCase().includes(searchTerm.toLowerCase());
    return matchCat && matchSearch;
  });

  if (selectedPost) {
    return (
      <div className="max-w-4xl mx-auto p-6">
        <button onClick={() => setSelectedPost(null)} className="mb-4 text-indigo-600">
          ← Back
        </button>
        <h1 className="text-3xl font-bold mb-2">{selectedPost.title}</h1>
        <img src={selectedPost.image} alt={selectedPost.title} className="w-full rounded-lg mb-4" />
        <p className="text-sm text-gray-500 flex items-center gap-2 mb-4">
          <Calendar size={14} /> {new Date(selectedPost.date).toLocaleDateString()} • {selectedPost.readTime}
        </p>
        <p className="mb-4">{selectedPost.content}</p>
        <div className="flex gap-2">
          {selectedPost.tags.map((tag) => (
            <span key={tag} className="px-2 py-1 bg-indigo-100 text-indigo-600 rounded-md text-xs flex items-center gap-1">
              <Tag size={10} /> {tag}
            </span>
          ))}
        </div>
      </div>
    );
  }

  return (
    <div className="max-w-6xl mx-auto p-6">
      <h1 className="text-4xl font-bold text-center mb-6">✨ NumPath Blog</h1>

      {/* Search */}
      <div className="flex items-center bg-gray-100 rounded-lg px-3 py-2 max-w-md mx-auto mb-6">
        <Search size={16} className="text-gray-500" />
        <input
          type="text"
          placeholder="Search articles..."
          className="bg-transparent outline-none px-2 w-full"
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
        />
      </div>

      {/* Categories */}
      <div className="flex gap-3 justify-center mb-6 flex-wrap">
        {categories.map((cat) => (
          <button
            key={cat}
            onClick={() => setSelectedCategory(cat)}
            className={`px-4 py-1 rounded-full text-sm ${
              selectedCategory === cat ? "bg-indigo-600 text-white" : "bg-gray-200"
            }`}
          >
            {cat}
          </button>
        ))}
      </div>

      {/* Blog posts */}
      <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-6">
        {filteredPosts.map((post) => (
          <div key={post.id} className="bg-white shadow rounded-lg overflow-hidden">
            <img src={post.image} alt={post.title} className="w-full h-48 object-cover" />
            <div className="p-4">
              <span className="text-xs text-indigo-600">{post.category}</span>
              <h3 className="text-lg font-semibold mt-1">{post.title}</h3>
              <p className="text-gray-600 text-sm mb-3">{post.excerpt}</p>
              <div className="text-xs text-gray-500 flex items-center gap-2 mb-3">
                <User size={14} /> {post.author} • {post.readTime}
              </div>
              <button
                onClick={() => setSelectedPost(post)}
                className="text-indigo-600 flex items-center gap-1"
              >
                Read More <ArrowRight size={14} />
              </button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Blog;
